\viewkind4\uc1\pard\fs20 ESTABA DE LA MANO IZQUIERDA DE LA AVDA PER\'d3N ESPERANDO POR QUE EL SEMAFORO ESTABA EN ROJO.ACTO SEGUIDO, DOS PEATONES CRUZAN LA AVDA QUEDANDO AL FINAL DEL CANTERO. CUANDO INICIO LA MARCHA UNA RUEDA DE MI AUTO AL PARECER DA\'d1\'d3 LA MOCHILA CON RUEDITAS QUE SEG\'daN EL ANCIANO (UNO DE LOS PEATONES) LA LLEVABA UNA NENA QUE SALIA DEL COLEGIO.- TERCERO(2):SEXO FEMENINO, MENOR DE EDAD. DESCONOCE DATOS. LOS TERCEROS SE RETIRARON POR SUS PROPIOS MEDIOS. \par
\par
\ul\b AMPLIACION\ulnone\b0\par
\cf1 Estaba parado por sem\'e1foro rojo sobre la calle Av. Presidente Per\'f3n, esquina Perito Moreno. Veo que cruza la calle un Sr. mayor con su nieta con uniforme y  mochila carro escolar; se detienen en un cantero que divide la Av. Presidente Per\'f3n, quedado a la izquierda de mi veh\'edculo. Cuando da luz verde avanzo lentamente y me llama la atenci\'f3n que el Sr. me insulte y sigue caminando. Preocupado por si hab\'eda pasado algo, doy la vuelta manzana para ver que todo este bien y me detengo para consultarle "\'bfsi estaba todo bien?"; a esto el Sr. me responde mostr\'e1ndome la mochila carro escolar con una rueda rota y dici\'e9ndome que le hab\'eda pisado la mochila a la menor. A lo cual le pido la direcci\'f3n para poder acercarle una mochila nueva, motivo por el cual, tengo la direcci\'f3n del Sr.. El mismo d\'eda, m\'e1s tarde, me acerco a la direcci\'f3n que me hab\'eda indicado con una mochila de similares caracter\'edstica; que cumpl\'eda la misma funci\'f3n. Al llegar al domicilio, me recibe el Sr. con su esposa y la nena. A la menor no le gusto del todo la mochila por lo cual me indicaron que volviera 18:30hs para conversar con los padres y dicidieron no recibirla. A lo cual por la mala actitud de la Sra. al hablarme, decido realizar la denuncia con mi seguro, previa conversaci\'f3n con la atenci\'f3n al cliente de ACA. En todo momento, tanto el Sr. como la menor, se los ve\'eda bien y no manifestaron ning\'fan reclamo adicional.\par
Contexto: gran caudal de autos y salida escolar.\par
\pard\sb100\sa100 - No intervino ninguna comisar\'eda.\par
\pard . Abuelo de la menor: Jos\'e9 Lop\'e9z. Direcci\'f3n: Godoy Cruz 2647, Los Polvorines, Malvinas Argentinas.\cf0\f1\par
\f0\par}

