{\rtf1\ansi\ansicpg1252\deff0\deflang11274{\fonttbl{\f0\fswiss\fprq2\fcharset0 Arial;}{\f1\fnil\fcharset0 Arial;}}
\viewkind4\uc1\pard\sa200\b\f0\fs20 MECANICA DEL HECHO SEGUN VERSION ASEGURADO: \b0 Asegurado circulaba por Av. Rivadavia y al girar en Carabobo, se encontraba un peat\'f3n mirando el celular, el cual avanzo y seg\'fan dice le pisa el pie derecho por lo que toca la parte delantera del veh\'edculo asegurado y cae al asfalto. hubo intervenci\'f3n policial y ambulancia. No hubo desplazamientos. el tercero fue trasladado al Hospital Alvarez, desconoce si quedo internado.\par
\b\par
\pard\sa160 AMPLAICION ASEGURADO: Por escrito. "\b0 intervino la Comisar\'eda 50. \f1 Manifest\'f3 que no le realizaron test de alcoholemia.\b  \b0\f0 El tercero fue derivado al hospital Alvarez, aparentemente no tendr\'eda lesiones de gravedad. No tiene datos del tercero m\'e1s que los aportados en su momento al realizar la denuncia."\par
\pard\f1\par}

