{\rtf1\ansi\ansicpg1252\deff0\deflang11274{\fonttbl{\f0\fswiss\fprq2\fcharset0 Arial;}{\f1\fnil\fcharset0 Arial;}}
\viewkind4\uc1\pard\b\f0\fs20 MECANICA DEL HECHO S/ VS ASEGURADO: \b0 el aseg. circulaba por av. vernet (esq. calle fortunato lopez) detras de un colectivo, el colectivo frena en la parada para que bajen pasajeros, el aseg. lo pasa por la izquierda y al llegar a la esquina se cruza por delante del colectivo un peaton, el aseg. frena pero no puede evitar colisionar a la persona, la persona cae al suelo, segun indica tenia molestias en la rodilla izquierda. intervino policia, no ambulancia. el aseg. traslado al lesionado a su domicilio).\b\par
AMPLIACION ASEGURADO: \b0\f1 Me indica que en el siniestro se detuvo un patrullero que pasaba por la zona, pero al ver que el tercero no ten\'eda lesiones de gravedad o visibles prefirieron no intervenir. Le dijeron al asegurado que lo lleve \'e9l a un hospital o a la casa. \par
El asegurado le ofreci\'f3 al tercero llevarlo a un hospital pero este no quizo, s\'f3lo le pidi\'f3 que lo lleve hasta la casa. Al llegar al domicilio del tercero se retir\'f3 del lugar r\'e1pidamente porque se trataba de una villa. No tiene nombre de la calle ni n\'famero de la casa. S\'f3lo sabe que es una villa que se encuentra frente al Hospital 21. El asegurado le dej\'f3 su tel\'e9fono al tercero pero \'e9ste no se ha comunicado. El tercero s\'f3lo le dej\'f3 su n\'famero de DNI de paraguay, no tiene argentino. Agrega adem\'e1s que el tercero se encontraba en estado de ebriedad. \par
\par}

{\rtf1\ansi\ansicpg1252\deff0\deflang11274{\fonttbl{\f0\fswiss\fprq2\fcharset0 Arial;}{\f1\fswiss\fprq2\fcharset0 Calibri;}{\f2\fnil\fcharset0 Arial;}}
\viewkind4\uc1\pard\b\f0\fs20 MECANICA DEL HECHO SEGUN VERSION ASEGURADO: \b0 Veh\'edculo asegurado se detiene repentinamente sobre Rafaela ante un tercero que se detiene adelante. Ante esto el asegurado maniobraba para atr\'e1s para evitar el choque, y all\'ed impacta levemente ante un peat\'f3n que justo se dispuso a cruzar la calle. Sin desplazamientos ni lesionados. (Peat\'f3n: interviene polic\'eda y ambulancia. se levanta por sus medios)\f1\fs22\par
\pard\sa200\sl360\slmult1\b\f0\fs20\par
\pard MECANICA DEL HECHO SEGUN TERCERO: "\b0 el dia 2/12 aproximadamente a las 17hs se dirig\'eda a pie hacia una papelera ubicada en la calle D\'b4Onofrio, lo hac\'eda por la calle esta ultima y al llegar a la intersecci\'f3n con Rafaela antes de cruzar por la senda peatonal visualiza que una camioneta marca Volkswagen Amarok dominio JKM841 se encontraba detenida a un costado mientras que por detr\'e1s se encontraba detenido un Peugeot, por lo que el dicente comienza a cruzar la calle ya que le transito estaba detenido, sin embargo antes de llegar a la vereda la camioneta Amarok realiza marcha atr\'e1s  y lo embiste al deponente apret\'e1ndole la pierna contra el Peugeot. El dicente cae al suelo. \f2 Lo asisti\'f3 la ambulancia  y lo traslado al Hospital Posadas de Moron donde le realizaron estudios y le informaron que no posee lesiones \'f3seas pero que debe tener inmovilizada la rodilla y realizar kinesiolog\'eda. \f0 "\f1\fs22\tab  \par
\f2\fs20\par}

